contracts/FundMe.sol.content:
/***Goals:
1. Get funds from users
2. Withdraw fund(Only owner of the fund is allowed to do so)
3. Set a minimum funding amount in usd
***/

//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import './PriceConverter.sol';

contract FundMe{
    using PriceConverter for uint256;
    uint256 public minUsd = 50 * 1e18;

    //array to store all the people who sent fund to us
    address[] public funders;
    mapping(address => uint256) public addressToAmountFunded;

    function fund() public payable{ 
        require(msg.value.getConversionRate() >= minUsd, "Didn't send enough");
        funders.push(msg.sender);
        addressToAmountFunded[msg.sender] = msg.value;
    }

    // function Withdraw(){}
}

contracts/PriceConverter.sol.content:
//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library PriceConverter{
    function getPrice() public view returns(uint256){
        //address: 	0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        //since this return five variables
        ( , int256 price, , , ) = priceFeed.latestRoundData();
        //now this price will be the price of eth in terms of usd
        //as this price will be of 8 digits and the msg.value is in wei (1eth = 10^18 wei) we need to multiplly it with 10 more zeroes
        return uint256(price * 1e10);
    }

    function getVersion() public view returns(uint256){
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        return priceFeed.version();
    }

    function getConversionRate(uint256 ethAmount) public view returns(uint256) {
        uint256 ethPrice = getPrice();
        uint256 ethAmountInUsd = (ethPrice * ethAmount) / 1e18;
        return ethAmountInUsd;
    }


}

